import React from 'react'
import CustomTableTbody from './tableBody/CustomTableTbody'
import CustomTableThead from './tableHead/CustomTableThead'
import styles from "./customTable.module.scss";

const customTable = (props) => {
  return (
    <>
      <table width='100%' border='1px' className={styles.tableClass}>
        <CustomTableThead thradData={props.data} />
        <CustomTableTbody tbodyData={props.data} />
      </table>
    </>
  )
}

export default customTable
